create table PMS_SHORT_MSG_TEMP
(
    ID               NUMBER(12)                             not null
        constraint PMS_SHORT_MSG_RT_PK
            primary key,
    MSG_ID           NUMBER(12)                             not null,
    CUSTOMER_ID_FROM NUMBER(10)                             not null,
    CUSTOMER_ID_TO   NUMBER(10)                             not null,
    FINISHED         NUMBER(1)    default 0                 not null,
    CREATE_TIME      TIMESTAMP(6) default CURRENT_TIMESTAMP not null,
    UPDATE_TIME      TIMESTAMP(6) default CURRENT_TIMESTAMP not null,
    VERSION          NUMBER(8)    default 0                 not null
)
/

comment on column PMS_SHORT_MSG_TEMP.ID is 'ID'
/

comment on column PMS_SHORT_MSG_TEMP.MSG_ID is '寄件主檔 ID'
/

comment on column PMS_SHORT_MSG_TEMP.CUSTOMER_ID_FROM is '起始的customer ID'
/

comment on column PMS_SHORT_MSG_TEMP.CUSTOMER_ID_TO is '結束的customer ID'
/

comment on column PMS_SHORT_MSG_TEMP.FINISHED is '0 : false, 1: true'
/

comment on column PMS_SHORT_MSG_TEMP.CREATE_TIME is '建立時間'
/

comment on column PMS_SHORT_MSG_TEMP.UPDATE_TIME is '更新時間'
/

comment on column PMS_SHORT_MSG_TEMP.VERSION is '更新版本'
/

create index PMS_MSG_TEMP_IDX_STATUS
    on PMS_SHORT_MSG_TEMP (FINISHED)
/

